css:
autocomplete-suggestion-list.select-list.popover-list {
  width: auto;
  display: inline-block;
  min-width: 200px;
}
autocomplete-suggestion-list.select-list.popover-list input {
  position: absolute;
  opacity: 0.00;
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group {
  max-height: 50vh;
  overflow-y: auto;
  margin-top: 0;
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li {
  color: rgba(176, 182, 182, 0.9);
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li:after {
  clear: both;
  display: block;
  content: ' ';
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li .word {
  float: left;
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li .character-match {
  font-weight: bold;
  color: #e0e8e8;
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li.selected .completion-label {
  color: #b0b6b6;
}
autocomplete-suggestion-list.select-list.popover-list ol.list-group li .completion-label {
  float: right;
  padding-right: 6px;
  padding-left: 6px;
}
